import { List } from "semantic-ui-react";

export const getFeedContent = (username, token) => {
    const FeedContent = (
        <List celled>
            <List.Item as="a">Feed #1</List.Item>
            <List.Item as="a">Feed #2</List.Item>
            <List.Item as="a">Feed #3</List.Item>
            <List.Item as="a">Feed #4</List.Item>
            <List.Item as="a">Feed #5</List.Item>
            <List.Item as="a">Feed #6</List.Item>
            <List.Item as="a">Feed #7</List.Item>
            <List.Item as="a">Feed #8</List.Item>
            <List.Item as="a">Feed #9</List.Item>
            <List.Item as="a">Feed #10</List.Item>
            <List.Item as="a">Feed #11</List.Item>
            <List.Item as="a">Feed #12</List.Item>
        </List>
    )
    return FeedContent;
}
